import { Link, useParams } from "react-router-dom";

export default function EventDetailPage() {
  const params = useParams();
  return (
    <>
      <h1>My Event Detail Page</h1>
      <p>{params.eventId}</p>
      <button>
        <Link to="edit">Edit</Link>
      </button>
      <button>
        <Link to=".." relative="path">
          Back
        </Link>
      </button>
    </>
  );
}
